/**
 28. 实现 strStr()
 https://leetcode-cn.com/problems/implement-strstr/
 */

import UIKit

class Solution {
    ///超时了
    func strStr(_ haystack: String, _ needle: String) -> Int {
        if needle.count == 0 || haystack == needle {
            return 0
        }
        if haystack.count < needle.count {
            return -1
        }

        let iRange = 0 ... (haystack.count - needle.count)

        for i in iRange {
            let startIndex = haystack.index(haystack.startIndex, offsetBy: i)
            let endIndex = haystack.index(startIndex, offsetBy: needle.count)
            let haystackRange = haystack[startIndex ..< endIndex]

            if haystackRange == needle {
                return i
            } else {
                continue
            }
        }

        return -1
    }
}

print(Solution().strStr("",
                        ""))
